import React, { useState } from 'react';
import axios from 'axios';
import '../../styles/contentManagement.css';

const ContentManagement = () => {
  const [quizCards, setQuizCards] = useState([]);
  const [newQuizCardTitle, setNewQuizCardTitle] = useState('');
  const [newQuizCardNoOfQuestions, setNewQuizCardNoOfQuestions] = useState('');

  const [quizzes, setQuizzes] = useState([]);
  const [newQuizCardId, setNewQuizCardId] = useState('');
  const [newQuestion, setNewQuestion] = useState('');
  const [newOption1, setNewOption1] = useState('');
  const [newOption2, setNewOption2] = useState('');
  const [newOption3, setNewOption3] = useState('');
  const [newOption4, setNewOption4] = useState('');
  const [newCorrectAnswer, setNewCorrectAnswer] = useState('');

  const handleAddQuizCard = async () => {
    try {
      const response = await axios.post('http://localhost:5164/addQuizCard', {
        eventID: "1001",
        addInfo: {
          title: newQuizCardTitle,
          no_of_questions: newQuizCardNoOfQuestions
        }
      });

      console.log("Response from addQuizCard API:", response);

      const data = response.data;
      if (data && data.rData && data.rMessage === "Successful") {
        console.log("Quiz card added successfully");
        setQuizCards([...quizCards, { id: data.rData.quiz_card_id, title: newQuizCardTitle, no_of_questions: newQuizCardNoOfQuestions }]);
        setNewQuizCardTitle('');
        setNewQuizCardNoOfQuestions('');
      } else {
        console.log("Failed to add quiz card:", data);
      }
    } catch (error) {
      console.error('Error adding quiz card:', error);
    }
  };

  const handleAddQuiz = async () => {
    try {
      const response = await axios.post('http://localhost:5164/addQuiz', {
        eventID: "1001",
        addInfo: {
          quiz_card_id: newQuizCardId,
          question: newQuestion,
          option1: newOption1,
          option2: newOption2,
          option3: newOption3,
          option4: newOption4,
          correct_answer: newCorrectAnswer
        }
      });

      console.log("Response from addQuiz API:", response);

      const data = response.data;
      if (data && data.rData && data.rMessage === "Successful") {
        console.log("Quiz added successfully");
        setQuizzes([...quizzes, { quiz_card_id: newQuizCardId, question: newQuestion, option1: newOption1, option2: newOption2, option3: newOption3, option4: newOption4, correct_answer: newCorrectAnswer }]);
        setNewQuizCardId('');
        setNewQuestion('');
        setNewOption1('');
        setNewOption2('');
        setNewOption3('');
        setNewOption4('');
        setNewCorrectAnswer('');
      } else {
        console.log("Failed to add quiz:", data);
      }
    } catch (error) {
      console.error('Error adding quiz:', error);
    }
  };

  return (
    <div className="content-management-container">
      <h2>Quiz Management</h2>

      <section>
        <h3>Add Quiz Card</h3>
        <input
          type="text"
          value={newQuizCardTitle}
          onChange={(e) => setNewQuizCardTitle(e.target.value)}
          placeholder="Quiz Card Title"
        />
        <input
          type="number"
          value={newQuizCardNoOfQuestions}
          onChange={(e) => setNewQuizCardNoOfQuestions(e.target.value)}
          placeholder="Number of Questions"
        />
        <button onClick={handleAddQuizCard}>Add Quiz Card</button>
      </section>

      <section>
        <h3>Add Quiz</h3>
        <input
          type="text"
          value={newQuizCardId}
          onChange={(e) => setNewQuizCardId(e.target.value)}
          placeholder="Quiz Card ID"
        />
        <input
          type="text"
          value={newQuestion}
          onChange={(e) => setNewQuestion(e.target.value)}
          placeholder="Question"
        />
        <input
          type="text"
          value={newOption1}
          onChange={(e) => setNewOption1(e.target.value)}
          placeholder="Option 1"
        />
        <input
          type="text"
          value={newOption2}
          onChange={(e) => setNewOption2(e.target.value)}
          placeholder="Option 2"
        />
        <input
          type="text"
          value={newOption3}
          onChange={(e) => setNewOption3(e.target.value)}
          placeholder="Option 3"
        />
        <input
          type="text"
          value={newOption4}
          onChange={(e) => setNewOption4(e.target.value)}
          placeholder="Option 4"
        />
        <input
          type="text"
          value={newCorrectAnswer}
          onChange={(e) => setNewCorrectAnswer(e.target.value)}
          placeholder="Correct Answer"
        />
        <button onClick={handleAddQuiz}>Add Quiz</button>
      </section>
    </div>
  );
};

export default ContentManagement;
